import React from 'react'
import { SearchIcon } from "../../ass";
import "./Search.module.css";
const SearchBar = () => {
  return (
    <>
      <div className="wrapper">
        <input className="search" />
        <button className="search-btn">
          <SearchIcon />
        </button>
      </div>
    </>
  );
};

export default SearchBar;


export const Search = () => {
  return (
    <div>Search</div>
  )
}
